r.c.F(0,A.aw(["en_US",A.aw(["about_me","I am passionate about technology and a self-taught individual by nature. For over 10 years, I have been involved in the world of programming, acquiring knowledge and skills through constant practice and research. I have a keen interest in the field of digital electronics and enjoy understanding how things work.\n\nI love staying active and exercising, so swimming and kayaking are some of my favorite activities.In addition, I enjoy the freedom and adventure that traveling on a motorcycle brings, exploring countries and discovering new cultures.\n\nWith a strong work ethic and dedication to my craft, I have accumulated extensive experience in programming and software development, capable of handling projects of any size and complexity. I am a creative, curious, and passionate individual with the ability to solve problems and find innovative solutions to any challenge that may arise.",p,"My programming journey started in 2007 when I began to explore the world of microcontrollers as a self-taught learner. Specifically, one of the first microcontrollers that I used was the PIC16x series from Microchip. As I progressed in my learning, I discovered the various possibilities that microcontroller programming offered and realized that this was my true passion.\n\nIn my early encounters with microcontroller programming, I learned some basic Assembler instructions, which helped me understand how hardware operations worked. Later, I continued with the programming language C, using thenamespace, and completed several learning projects such as a centralized lighting controller, an automatic irrigation system, and an environmental variable monitoring system. These projects allowed me to understand the importance of structured programming and helped me acquire the necessary skills to develop more complex solutions.\n\nOver time, my interests in programming expanded into other areas, and I decided to continue my studies in the field of computer science. This led me to obtain a degree in Systems Analysis and Programming, where I continued developing my programming skills, mainly using object-oriented paradigms with Java and Python. These languages allowed me to work on more ambitious projects, such as the development of a hotel reservation system and a messaging platform integration, among others.\n\nCurrently, my favorite language for frontend development is Dart using the Flutter framework, while for backend development, I usually use Python due to its versatility and my extensive experience with it. I am also exploring the Rust language to expand my skills.\n\nIn conclusion, my beginnings in programming with PIC16x microcontrollers allowed me to discover my passion for programming and develop the skills necessary to tackle new challenges in the field of computer science.",o,"From my perspective, soft skills are a fundamental aspect for personal and professional growth. I have realized that throughout my life, these skills have naturally developed through the experiences I have lived. Both in my work life and in my daily life, I have learned to handle difficult situations effectively and to find creative solutions to complex problems.\n\nAlthough I have always been a reserved person, I have learned to manage this characteristic of my personality more effectively over time. I have discovered that open and honest communication is essential for the success of any project, and I have worked to improve my communication skills to be able to convey my ideas clearly and effectively.\n\nThroughout my career, I have played different roles, from employee to entrepreneur and project leader. These experiences have given me the opportunity to develop a wide range of soft skills, such as teamwork, conflict resolution, and the ability to motivate others to achieve common goals.\n\nI have also faced difficult moments in my life, like most people. However, I have learned to overcome these obstacles with resilience and determination. These experiences have taught me the importance of being an empathetic and understanding leader, capable of supporting others in difficult times and fostering a positive and collaborative work environment.\n\nAlthough I still have much to learn and improve in terms of soft skills, I am confident that I have the ability to lead projects and achieve goals both individually and as part of a team. I believe that with a positive attitude, an open mindset, and a strong commitment, I can continue to grow and develop these skills to be a more effective and successful leader in the future.","sysadmin_text","My interest in the world of systems administration were in 2008 thanks to the Hack x Crack notebooks, which I read and kept on hand to practice with. I got them in PDF format since they were no longer for sale by that time, but much of their content remains valid to this day.\n\nAlthough as a full stack developer I have not delved so much into this area, my work experience from 2010 to 2012 introduced me to the world of servers. I performed RAID configurations on IBM and HP servers, also installed and configured operating systems, remote access and monitoring tools on both Windows Server and Linux operating systems.\n\nIn addition, I completed a networking course where I learned the theoretical concepts, but in the workplace, I gained experience configuring Cisco routers, hardware firewalls, and VLANs on Cisco switches. I have also had experience setting up complete racks where I had to connect UTP and fiber optic patches, and configure and install the corresponding operating system.\n\nCurrently, I have deepened my studies in web servers and have put into practice a cluster in Kubernetes. I also have experience with some services on the Google Cloud platform.\n\nMy work experience and interest in continuous learning have allowed me to acquire knowledge and skills in systems administration, which has given me a broader vision of the world of technology and enabled me to effectively solve problems.","full_stack_text","To me, being a full stack developer is a challenging and exciting task that involves being able to carry out all the necessary tasks to create a complete application ready for its intended audience. In my case, not only web applications, but also mobile and embedded systems.\nFrom designing and implementing the front-end to managing servers and deployment.","frontend_text","As a frontend developer, our main responsibility is to create a pleasant user experience for the application we are building. This involves paying attention to user experience, design, and performance. To achieve this, it's necessary to observe the project from different perspectives, considering it as a whole, which can be quite challenging.\n\nThe client-side application requires much more than just design and user interface. It's also important to make efficient connections with the backend, use technologies for data persistence, process data, and present real information to the user. In addition, it's necessary to implement an adequate structure and keep the interface logic separate from the logic for data acquisition and processing. To all of this, we must add the consideration of aspects such as performance, compatibility, accessibility, testing, and finally, the implementation of a maintenance and update structure.\n\nIn summary, as a frontend developer, we must focus on creating a pleasant user experience, paying attention to design and performance. We must consider the application as a whole and observe it from different perspectives.","backend_text","As a backend developer, I have learned that one of the most important things is knowing how to implement a solid and scalable architecture. While there are many aspects to consider, such as performance and security, I believe that without a solid architecture to back it up, everything else is meaningless.\n\nFrom my perspective, the implementation of well-defined microservices and a well-structured database are the pillars of an effective backend system. Microservices are a way to divide an application into smaller, more manageable components, which makes scalability and maintenance easier. On the other hand, a good database design is crucial to ensure that data is stored efficiently and can be retrieved quickly.\n\nAdditionally, as a backend developer, I have also learned the importance of working collaboratively with other members of the development team, especially with frontend developers. Communication and collaboration are crucial to ensuring that the system runs smoothly and that project goals are met.","deployment_text","My experience with my own entrepreneurship has taught me that deploying an application in the real world is not a task for a single individual. It is necessary to take into account many aspects, such as security, performance, scalability, and accessibility of the application. Additionally, it is essential to work with the development team to achieve continuous integration, which ensures that the code is integrated and tested constantly as it is developed, reducing time and risks associated with deployment.\n\nOnce the application has been developed and the necessary tests have been carried out, it is time to deploy it. However, this process requires proper planning to ensure that everything works correctly in a production environment.\n\nFurthermore, once the application is in production, it is necessary to manage it properly to ensure that it continues to function smoothly and that necessary updates and maintenance are carried out. This may involve monitoring performance, identifying and resolving issues, implementing improvements and updates, and managing scalability to handle increases in traffic or workload.\n\n","electronic_text","I began my interest in electronics at the age of 9, reading the electronics section of an encyclopedia and experimenting with batteries and DC motors. I took a one-year course where I learned the fundamentals of analog electronics and experimented with components such as transistors and diodes. Then, I continued experimenting with basic integrated circuits such as the 555 timer and built circuits on PCB using components such as logic gates and shift registers. After several years, I acquired the necessary knowledge to experiment with microcontrollers, which was a major milestone in my life. The first code I wrote was in assembler and it was exciting to replicate the behavior of a 555 timer on a microcontroller.\n\nIn 2013, I built a CNC router using parts from discarded printers for my thesis project. The CNC software I developed had a graphical interface to create shapes and materialize them using my rudimentary CNC connected to the old parallel port (printer port). Although electronics started as a hobby for me, I made a camera switch for quick access that was installed on a catamaran. I also experimented with MicroPython and the Arduino IDE on embedded systems such as the ESP8266 and ATmega2560","about_me_title","Personal Information","about","About Me","_age","Age: ","_profession","Profession: ","_nationality","Nationality: ",n,"City of Residence: ","age","32 years.","profession",m,"nationality","Argentinian.",l,k,"programming","Programming","electronic","Electronic","sysadmin","Systems Administrator","soft_skills","Soft Skills","languages","Languages","queryLanguages","Query Languages","paradigms","Paradigms","objectOriented","Object Oriented (POO)","concurrent","Concurrent","reactive","Reactive","parallel","Parallel","funcional","Funcional","declarative","Declarative","serviceOriented","Service Oriented","_about_me","About Me","_knowledge","Skills","_experience","Experience","_projects","Projects","_contact","Contact",j,m,"frontend","Frontend","backend","Backend",i,"Deployment Management",h,"Structure Planification","database_design","Database Design",g,"Security Implementation","ux","User experience","ui","User interface","performance","Performance",f,"Deployment Structure","ci","Continuous Integration","cd","Continuous Delivery","qualitech_title","Qualitech","overup_title","OverUp","cyberlink_title","Cyberlink",e,"Independent","guazuapp_title","GuazuApp","qualitech_years","2011 - 2013","overUp_years","2015 - 2017","cyberlink_years","2017 - 2018",d,"2018 - 2020","guazuapp_years","Present",c,"IT solutions",b,"IT solutions",a,"IT company",a0,"Independent full-stack developer",a1,a2,a3,"Role: Network and systems technician.",a4,"Role: Co-founder and software developer and eventually expanded into electronics.",a5,"Role: General technician in the support area.",a6,"",a7,"Role: Co-founder, full-stack developer, and development leader.",a8,"Website: https://qualitech.com.ar/",a9,"",b0,"Website: https://cyberlink.com.ar/",b1,"",b2,"Web app: https://app.guazuapp.com.",b3,"",b4,"",b5,"",b6,"",b7,"Android app: https://play.google.com/store/apps/details?id=ar.guazuapp.guazuapp","cnc_cad_title","CNCAD",b8,"Camera Switch QuickAccess",b9,"Entity Project API","guazuApp_title","GuazuaApp","myResume_title","My Personal Resume",c0,"Prototype Design Software, CNC Software Controller, and Router for Polyethylene Cutting",c1,"The project was developed to facilitate boarding maneuvers by providing fast access to the cameras on a vessel",c2,"Real-time Notifications and Task Creation A GraphQL API written in Python utilizing WebSockets for Push Messages",c3,a2,c4,"I am excited to share my work with the community and hope it will be useful for other developers","cnc_cad_text","The decision to develop this project was driven by a desire to learn. Initiated in early 2013, it was completed in mid-2014 due to various reasons. The primary motivation behind the development of this project was to gain knowledge and experience in computer-programmed machining processes, independent of software and hardware already developed by third parties. In contrast to complex industrial CNC machines and software, this project provides a more basic perspective.\n\nThe objective of this project is to provide a foundational tool for students and individuals seeking to understand or venture into CNC machine processes.\n\nThe material, documentation, and experience gained from this project are intended to support and serve new ideas, whether for different purposes or not. Furthermore, individuals can use this prototype project as a basis to develop more elaborate and complex CNC systems.",c5,"In the source code repository there is a circuit schematic, 3D model (for Proteus) and the code for the microcontroller written in C. The system is 8-channel, includes a 16x2 LCD screen and a matrix keyboard. It is based on a PIC 18F4550 microcontroller, but can be downgraded to one with lower specs if needed.","entity_api_text","The project I'm describing is a software that provides a GraphQL-based API written in Python for task creation and tracking, as well as product requesting and real-time notifications to their recipients. The system communicates through WebSockets, allowing for efficient and real-time push messaging.\n\n Users can interact with the system and receive real-time notifications about the status of their tasks and orders. Additionally, the API has been designed to be easily integrable into other applications and systems.","guazuApp_text","Guaz\xfaApp is an app that pretends to be the next form of communication with your clients and inside your organization. Its an ambitious project that will integrate all your social media input in one place, redirecting your clients to the right people inside of your organization.\n\nIts not just that. Guaz\xfaApp is here to also boost internal communication","myResume_text","This website has been developed using Dart/Flutter technology. The widget for the 'Skills' section was created from scratch to offer a personalized and engaging experience. Soon, this widget will be available in the official package repository (pub.dev).",c6,"Web Page",c7,"Source Code",c8,"Source Code",c9,"App Web",d0,"Source Code",d1,"Source Code",d2,"",d3,"",d4,"Google PLay App",d5,"","show_more","Show more","show_less","Show less","send","SEND","clipboard","Copied to clipboard","contact_to_me","Get in touch!","required_field","This field is required",d6,"Your message is required!",d7,"Email address is incorrect format",d8,"An error occurred while sending the message.",d9,"The message was sent successfully","name","Name","phone","Phone"],s,s),"es_AR",A.aw(["about_me","Soy un apasionado de la tecnolog\xeda y un autodidacta por naturaleza. Desde hace m\xe1s de 10 a\xf1os, he he estado involucrado en el mundo de la programaci\xf3n, adquiriendo conocimientos y habilidades a trav\xe9s de la pr\xe1ctica y la investigaci\xf3n constante. Me interesa mucho el campo de la electr\xf3nica digital y disfruto entendiendo c\xf3mo funcionan las cosas.\n\nMe encanta mantenerme activo y hacer ejercicio, por lo que la nataci\xf3n y el kayak son algunas de mis actividades favoritas. Adem\xe1s, disfruto de la libertad y la aventura que proporciona viajar en motocicleta, recorriendo pa\xedses y descubriendo nuevas culturas.\n\nCon una fuerte \xe9tica de trabajo y dedicaci\xf3n a mi oficio, he logrado acumular una vasta experiencia en la programaci\xf3n y el desarrollo de software, siendo capaz de manejar proyectos de cualquier tama\xf1o y complejidad. Soy una persona creativa, curiosa y apasionada, con la capacidad de resolver problemas y encontrar soluciones innovadoras para cualquier desaf\xedo que se presente.",p,"Mis inicios de la programacion comenzaron en 2007 cuando empece a emprender como autodidacta con los microcontroladores para ser preciso unos de los primeros fueron los de la serie PIC16x de la marca Microchip. Aprend\xed algunas instruciones basicas de Assembler y posteriormente continue con C utilizando el compilador de Mplab relaice varios proyectos de aprendisaje.\n\nPosteriomente continue mis estudios de nivel terciario con la titulacion de Analista de sistema y programacion, donde continue desarrollando mis avilidades de  con programacion con los paradigmas orientado a object utilizando java y python.\n\nRecuerdo que uno de los primeros microcontroladores que utilic\xe9 fueron los de la serie PIC16x de la marca Microchip. A medida que avanzaba en mi aprendizaje, fui descubriendo las distintas posibilidades que ofrec\xeda la programaci\xf3n de microcontroladores, y pronto me di cuenta de que esto era lo que realmente me apasionaba.\nEn mis primeros acercamientos a la programaci\xf3n de microcontroladores, aprend\xed algunas instrucciones b\xe1sicas de Assembler, lo que me permiti\xf3 entender c\xf3mo funcionaban las operaciones a nivel de hardware. Posteriormente, continu\xe9 con el lenguaje de programaci\xf3n C, utilizando el compilador de MPLAB, y realic\xe9 varios proyectos de aprendizaje, como por ejemplo, un controlador de iluminacion centralizado, un sistema de riego autom\xe1tico y un sistema de monitoreo de variables ambientales. Estos proyectos me permitieron entender la importancia de la programaci\xf3n estructurada y me ayudaron a adquirir las habilidades necesarias para desarrollar soluciones m\xe1s complejas.\n\nCon el tiempo, mis intereses en la programaci\xf3n se expandieron hacia otras \xe1reas, y decid\xed continuar mis estudios en el \xe1mbito de la inform\xe1tica. Fue as\xed como obtuve la titulaci\xf3n de Analista de Sistemas y Programaci\xf3n, donde segu\xed desarrollando mis habilidades de programaci\xf3n, principalmente utilizando los paradigmas orientados a objetos con Java y Python. Estos lenguajes me permitieron trabajar en proyectos m\xe1s ambiciosos, como el desarrollo de una un sistema de reservas para hoteles, una plataforma de integracion de plataformas de mensajeria, entre otros.\n\nEn la actualidad, mi lenguaje favorito para el desarrollo de frontend es Dart utilizando el framework Flutter, mientras que para el backend suelo utilizar Python debido a su versatilidad y mi amplia experiencia con el. Aunque tambi\xe9n estoy explorando el lenguaje Rust para expandir mis habilidades.\n\nEn conclusi\xf3n, mis inicios en la programaci\xf3n con los microcontroladores PIC16x me permitieron descubrir mi pasi\xf3n por la programaci\xf3n y desarrollar las habilidades necesarias para enfrentar nuevos desaf\xedos en el \xe1mbito de la inform\xe1tica.",o,"Desde mi perspectiva, las habilidades blandas son un aspecto fundamental para el crecimiento personal y profesional. Me he dado cuenta de que, a lo largo de mi vida, estas habilidades se han ido desarrollando de manera natural a trav\xe9s de las experiencias que he vivido. Tanto en mi vida laboral como en mi d\xeda a d\xeda, he aprendido a manejar situaciones dif\xedciles de forma efectiva y a encontrar soluciones creativas a problemas complejos.\n\nSi bien siempre he sido una persona reservada, he aprendido a gestionar esta caracter\xedstica de mi personalidad de una manera m\xe1s efectiva con el tiempo. He descubierto que la comunicaci\xf3n abierta y honesta es esencial para el \xe9xito de cualquier proyecto, y me he esforzado por mejorar mis habilidades de comunicaci\xf3n para poder transmitir mis ideas de manera clara y efectiva.\n\nA lo largo de mi carrera, he desempe\xf1ado diferentes roles, desde empleado hasta emprendedor y l\xedder de proyectos. Estas experiencias me han brindado la oportunidad de desarrollar una amplia gama de habilidades blandas, como el trabajo en equipo, la resoluci\xf3n de conflictos y la capacidad de motivar a otros para lograr objetivos comunes.\n\nTambi\xe9n he enfrentado momentos dif\xedciles en mi vida, como la mayor\xeda de las personas. Sin embargo, he aprendido a superar estos obst\xe1culos con resiliencia y determinaci\xf3n. Estas experiencias me han ense\xf1ado la importancia de ser un l\xedder emp\xe1tico y comprensivo, capaz de apoyar a otros en momentos dif\xedciles y de fomentar un ambiente de trabajo positivo y colaborativo.\n\nSi bien todav\xeda tengo mucho por aprender y mejorar en t\xe9rminos de habilidades blandas, estoy seguro de que tengo la capacidad de liderar proyectos y alcanzar objetivos tanto individualmente como en equipo.\n\nCreo que, con una actitud positiva, una mentalidad abierta y un fuerte compromiso, puedo seguir creciendo y desarrollando estas habilidades para ser un l\xedder m\xe1s efectivo y exitoso en el futuro.","sysadmin_text","Mi interes en el mundo de la administraci\xf3n de sistemas fueron en 2007 gracias a los cuadernos de Hack x Crack, los cuales le\xeda y ten\xeda a mano para poner en pr\xe1ctica. Los consegu\xed en formato PDF ya que para esa fecha ya no estaban a la venta, pero gran parte de su contenido sigue siendo v\xe1lido hasta hoy en d\xeda.\n\nAunque como desarrollador full stack no he profundizado tanto en esta \xe1rea, mi experiencia laboral de 2010 a 2012 me introdujo en el mundo de los servidores. Realic\xe9 configuraciones de RAID en servidores IBM y HP, tambi\xe9n he instalado y configurado sistemas operativos, herramientas de acceso remoto y de monitoreo tanto en sistemas operativos Windows Server como Linux.\n\nAdem\xe1s, he realizado un curso de redes donde aprend\xed los conceptos te\xf3ricos, pero en el campo laboral tuve la experiencia de configurar routers Cisco, hardware firewalls y VLANs en switches Cisco. Tambi\xe9n he tenido la experiencia de montar racks completos donde ten\xeda que conectar los parches UTP y de fibra \xf3ptica, y configurar e instalar el sistema operativo correspondiente.\n\nActualmente he profundizado mis estudios en web servers y he puesto en practica un cluster en kubernets, tambien tengo experiencia con algunos servicios de la plataforma Google Clound.\n\nMi experiencia laboral y mi inter\xe9s en el aprendizaje constante me han permitido adquirir conocimientos y habilidades en la administraci\xf3n de sistemas, lo que me ha permitido tener una visi\xf3n m\xe1s amplia del mundo de la tecnolog\xeda y ser capaz de resolver problemas de manera efectiva.","full_stack_text","Para m\xed, ser un desarrollador full stack es una tarea desafiante y emocionante que implica ser capaz de llevar a cabo todas las tareas necesarias para crear una aplicaci\xf3n completa y lista para su p\xfablico destinado. En mi caso, no solo aplicaciones web, sino tambi\xe9n m\xf3viles y en sistemas embebidos.\nDesde el dise\xf1o y la implementaci\xf3n del front-end hasta la gesti\xf3n de servidores y el despliegue.","frontend_text","Como desarrollador frontend, nuestra principal responsabilidad es crear una experiencia agradable para el usuario de la aplicaci\xf3n que estamos creando. Esto implica prestar atenci\xf3n a la experiencia del usuario, al dise\xf1o y al rendimiento. Para lograrlo, es necesario observar el proyecto desde diferentes perspectivas, consider\xe1ndolo como un todo, lo cual puede resultar todo un reto.\n\nLa aplicaci\xf3n cliente requiere mucho m\xe1s que solo dise\xf1o e interfaz de usuario. Tambi\xe9n es importante realizar conexiones eficientes con el backend, utilizar tecnolog\xedas para la persistencia de datos, procesar datos y representar informaci\xf3n real al usuario. Adem\xe1s, es necesario implementar una estructura adecuada y mantener la l\xf3gica de la interfaz separada de la l\xf3gica para la adquisici\xf3n y procesamiento de datos, a todo esto le sumamos que se tiene que tener en cuenta aspectos como el rendimiento, compatibilidad, accessibilidad, pruebas y para finalizar implementar una estructura de mantenimento y actualizacion.\n\nEn resumen, como desarrollador frontend debemos enfocarnos en crear una experiencia de usuario agradable, prestando atenci\xf3n al dise\xf1o y al rendimiento. Debemos considerar la aplicaci\xf3n como un todo y observarla desde diferentes perspectivas.","backend_text","Como desarrollador backend, he aprendido que una de las cosas m\xe1s importantes es saber c\xf3mo implementar una arquitectura s\xf3lida y escalable. Si bien es cierto que hay muchos aspectos a tener en cuenta, como el rendimiento y la seguridad, considero que sin una arquitectura s\xf3lida que lo respalde, todo lo dem\xe1s carece de validez.\n\nDesde mi perspectiva, la implementaci\xf3n de microservicios bien definidos y una buena estructuraci\xf3n de la base de datos son los pilares de un sistema backend eficaz. Los microservicios son una forma de dividir una aplicaci\xf3n en componentes m\xe1s peque\xf1os y manejables, lo que facilita la escalabilidad y el mantenimiento. Por otro lado, una buen dise\xf1o de la base de datos es fundamental para garantizar que los datos se almacenen de manera eficiente y se puedan recuperar de manera r\xe1pida.\n\nAdem\xe1s, como desarrollador backend, tambi\xe9n he aprendido la importancia de trabajar de manera colaborativa con otros miembros del equipo de desarrollo, especialmente con los desarrolladores frontend. La comunicaci\xf3n y la colaboraci\xf3n son fundamentales para garantizar que el sistema funcione sin problemas y que se cumplan los objetivos del proyecto.","deployment_text","Mi experiencia con mi propio emprendimiento me ha ense\xf1ado que desplegar una aplicaci\xf3n en el mundo real no es tarea de un solo individuo. Es necesario tener en cuenta muchos aspectos, como la seguridad, el rendimiento, la escalabilidad y la accesibilidad de la aplicaci\xf3n. Adem\xe1s, es fundamental trabajar con el equipo de desarrollo para lograr una integraci\xf3n continua, que garantice que el c\xf3digo se integre y pruebe constantemente a medida que se desarrolla, lo que reduce el tiempo y los riesgos asociados al despliegue.\n\nUna vez que se ha desarrollado la aplicaci\xf3n y se han realizado las pruebas necesarias, llega el momento de desplegarla. Sin embargo, este proceso requiere de una planificaci\xf3n adecuada para garantizar que todo funcione correctamente en un entorno de producci\xf3n.\n\nAdem\xe1s, una vez que la aplicaci\xf3n est\xe1 en producci\xf3n, es necesario gestionarla adecuadamente para garantizar que siga funcionando sin problemas y que se realicen las actualizaciones y mantenimientos necesarios. Esto puede implicar la supervisi\xf3n del rendimiento, la identificaci\xf3n y resoluci\xf3n de problemas, la implementaci\xf3n de mejoras y actualizaciones, y la gesti\xf3n de la escalabilidad para manejar aumentos en el tr\xe1fico o la carga de trabajo.","electronic_text","Comenc\xe9 mi inter\xe9s por la electr\xf3nica a los 9 a\xf1os, leyendo la secci\xf3n de electr\xf3nica de una enciclopedia y experimentando con pilas y motores DC. Tom\xe9 un curso de un a\xf1o donde aprend\xed los fundamentos de la electr\xf3nica anal\xf3gica y experiment\xe9 con componentes como transistores y diodos. Luego, segu\xed experimentando con circuitos integrados b\xe1sicos como el CI 555 y constru\xed circuitos en PCB utilizando componentes como compuertas l\xf3gicas y registros de desplazamiento. Despu\xe9s de varios a\xf1os, adquir\xed los conocimientos necesarios para experimentar con microcontroladores, lo que fue un hito importante en mi vida. El primer c\xf3digo que escrib\xed fue en Assembler y fue emocionante replicar el comportamiento de un temporizador 555 en un microcontrolador.\n\nEn 2013, constru\xed un router CNC con partes de impresoras de descarte para mi proyecto de tesis. El software CNC que desarroll\xe9 ten\xeda una interfaz gr\xe1fica para realizar formas y materializarlas mediante mi rudimentario CNC conectado al antiguo puerto paralelo (puerto de impresora). Aunque la electr\xf3nica comenz\xf3 como un hobby para m\xed, realic\xe9 un conmutador de c\xe1maras para acceso r\xe1pido que se instal\xf3 en una embarcaci\xf3n (Catamar\xe1n). Tambi\xe9n he experimentado con MicroPython y la IDE de Arduino en sistemas embebidos como el ESP8266 y el ATmega2560","about_me_title","Informaci\xf3n Personal","about","Sobre M\xed","_age","Edad: ","_nationality","Nacionalidad: ","_profession","Profesi\xf3n: ",n,"Ciudad de Residencia: ","age","32 a\xf1os.","nationality","Argentino.","profession",m,l,k,"programming","Programaci\xf3n","electronic","Electr\xf3nica","sysadmin","Administrador de sistemas","soft_skills","Habilidades blandas","languages","Lenguajes","queryLanguages","Lenguajes de consulta","paradigms","Paradigmas","objectOriented","Orientada a objectos (POO)","concurrent","Concurrente","reactive","Reactiva","parallel","Paralelo","funcional","Funcional","declarative","Declarativo","serviceOriented","Orientada a Servicio","_about_me","Sobre M\xed","_knowledge","Habilidades","_experience","Experiencia","_projects","Projectos","_contact","Contacto",j,"Desarrollador Full Stack","frontend","Interfaz","backend","Back-end",i,"Gesti\xf3n de Despliegue",h,"Planificaci\xf3n de la Estructura","database_design","Dise\xf1o de Base de Datos",g,"Implementaci\xf3n de Seguridad","ux","Experiencia de Usuario","ui","Interfaz de Usuario","performance","Performance",f,"Estructura de Despliegue","ci","Integraci\xf3n Continua","cd","Entrega Continua","qualitech_title","Qualitech","overup_title","OverUp","cyberlink_title","Cyberlink",e,"Independiente","guazuapp_title","GuazuApp","qualitech_years","2011 - 2013","overUp_years","2015 - 2017","cyberlink_years","2017 - 2018",d,"2018 - 2020","guazuapp_years","Actualidad",c,e0,b,e0,a,"Empresa de inform\xe1tica",a0,"Desarrollador full stack independiente",a1,e1,a3,"Rol: T\xe9cnico en redes y sistemas.",a4,"Rol: Socio fundador, desarrollador de software y, eventualmente, en el \xe1rea de electr\xf3nica.",a5,"Rol: T\xe9cnico general en el \xe1rea de soporte.",a6,"",a7,"Rol: Socio fundador, desarrollador full stack y l\xedder de desarrollo.",a8,"P\xe1gina web: https://qualitech.com.ar/",a9,"",b0,"P\xe1gina web: https://cyberlink.com.ar/",b1,"",b2,"Aplicaci\xf3n web: https://app.guazuapp.com.",b3,"",b4,"",b5,"",b6,"",b7,"Aplicaci\xf3n para Android: https://play.google.com/store/apps/details?id=ar.guazuapp.guazuapp","cnc_cad_title","CNCAD",b8,"Conmutador de Camara, QuickAccess",b9,"entity API","guazuApp_title","GuazuaApp","myResume_title","Mi Curr\xedculum Personal",c0,"Software de dise\xf1o de prototipos, controlador de software CNC y enrutador para corte de polietileno",c1,"El proyecto fue desarrollado para facilitar las maniobras de abordaje al proporcionar un acceso r\xe1pido a las c\xe1maras en una embarcaci\xf3n.",c2,"Notificaciones en tiempo real y creaci\xf3n de tareas Una API GraphQL escrita en Python que utiliza WebSockets para mensajes push",c3,e1,c4,"Estoy emocionado de compartir mi trabajo con la comunidad y espero que sea \xfatil para otros desarrolladores.","cnc_cad_text","La decisi\xf3n de desarrollar este proyecto fue impulsada por el deseo de aprender. Iniciado a principios de 2013, se complet\xf3 a mediados de 2014 por diversas razones. La principal motivaci\xf3n detr\xe1s del desarrollo de este proyecto fue ganar conocimiento y experiencia en procesos de maquinado programados por computadora, independientes del software y hardware ya desarrollado por terceros. A diferencia de las complejas m\xe1quinas CNC industriales y el software, este proyecto ofrece una perspectiva m\xe1s b\xe1sica.\n\nEl objetivo de este proyecto es proporcionar una herramienta fundamental para estudiantes e individuos que buscan comprender o aventurarse en los procesos de m\xe1quinas CNC.\n\nEl material, la documentaci\xf3n y la experiencia obtenida de este proyecto est\xe1n destinados a respaldar y servir nuevas ideas, ya sea para diferentes prop\xf3sitos o no. Adem\xe1s, las personas pueden utilizar este proyecto prototipo como base para desarrollar sistemas CNC m\xe1s elaborados y complejos.",c5,"En el repositorio del codigo fuente se encuentra esquema de circuito, modelo 3D (para Proteus) y el c\xf3digo para el microcontrolador escrito en C, El sistema es de 8 canales, incluye una pantalla LCD 16x2 y un teclado de matriz. Se basa en un microcontrolador PIC 18F4550, pero puede ser reemplazado por uno que tenga especificaciones m\xe1s bajas si es necesario.","entity_api_text","El proyecto es un software que proporciona una API basada en GraphQL escrita en Python para la creaci\xf3n y seguimiento de tareas, as\xed como la solicitud de productos y notificaciones en tiempo real a sus destinatarios. El sistema se comunica a trav\xe9s de WebSockets, lo que permite una mensajer\xeda push eficiente y en tiempo real.\n\n Los usuarios pueden interactuar con el sistema y recibir notificaciones en tiempo real sobre el estado de sus tareas y pedidos. Adem\xe1s, la API ha sido dise\xf1ada para ser f\xe1cilmente integrable en otras aplicaciones y sistemas.","guazuApp_text","Guaz\xfaApp es una aplicaci\xf3n que pretende ser la pr\xf3xima forma de comunicaci\xf3n con tus clientes y dentro de tu organizaci\xf3n. Es un proyecto ambicioso que integrar\xe1 todas las interacciones de tus redes sociales en un solo lugar, redirigiendo a tus clientes a las personas adecuadas dentro de tu organizaci\xf3n.\n\nNo es solo eso. Guaz\xfaApp tambi\xe9n est\xe1 aqu\xed para impulsar la comunicaci\xf3n interna.","myResume_text","Este sitio web ha sido desarrollado utilizando la tecnolog\xeda de Dart/Flutter. El widget de la secci\xf3n 'Habilidades' fue creado desde cero para ofrecer una experiencia personalizada y atractiva. Pronto, este widget estar\xe1 disponible en el repositorio oficial de paquetes (pub.dev).",c6,"P\xe1gina Web",c7,"C\xf3digo Fuente",c8,"C\xf3digo Fuente",c9,"App Web",d0,"C\xf3digo Fuente",d1,"C\xf3digo Fuente",d2,"",d3,"",d4,"Google PLay App",d5,"","show_more","Mostrar m\xe1s","show_less","Mostrar menos","send","ENVIAR","clipboard","Copiado al portapales","contact_to_me","\xa1Cont\xe1ctame!","required_field","Este campo es necesario.",d6,"T\xfa mensaje es requerido!",d7,"La direcci\xf3n de correo electr\xf3nico tiene un formato incorrecto.",d8,"Se produjo un error al enviar el mensaje.",d9,"El mensaje fue enviado con \xe9xito.","name","* Nombre","phone","Tel\xe9fono"],s,s)],s,t.GU))
